import React from 'react';
import {Radio,RadioGroup,FormControlLabel} from '@mui/material';
import { ReactComponent as SocialMedia } from '../../assets/images/social-media.svg';
import { ReactComponent as Catering } from '../../assets/images/catering.svg';
import { ReactComponent as TranslatorIcon } from '../../assets/images/translator-icon.svg';
import { ReactComponent as AccountanIocn } from '../../assets/images/accountan-icon.svg';
import { ReactComponent as WritingIcon } from '../../assets/images/writing-icon.svg';
import { ReactComponent as ShopIcon } from '../../assets/images/shop-icon.svg';
import './homeStyles.scss'
const socialRadio = <><SocialMedia/><span>Social media <br/> assistant</span></>;
const cateringRadio = <><Catering/><span>Catering</span></>;
const translatorRadio = <><TranslatorIcon/><span>Translator</span></>;
const AccountantRadio = <><AccountanIocn/><span>Accountant</span></>;
const contentRadio = <><WritingIcon/><span>Content writer</span></>;
const shopRadio = <><ShopIcon/><span>Shop keeper</span></>;
const JobFilter=(props)=> {
    return (
        <RadioGroup
              aria-labelledby="demo-radio-buttons-group-label"
              defaultValue="female"
              name="radio-buttons-group"
            >
              <FormControlLabel value="social_media" control={<Radio />} label={socialRadio}/>
              <FormControlLabel value="catering" control={<Radio />} label={cateringRadio} />
              <FormControlLabel value="translator" control={<Radio />} label={translatorRadio} />
              <FormControlLabel value="accountant" control={<Radio />} label={AccountantRadio} />
              <FormControlLabel value="content_writer" control={<Radio />} label={contentRadio} />
              <FormControlLabel value="shop_keeper" control={<Radio />} label={shopRadio} />
            </RadioGroup>
    )
}
export default JobFilter;
